	public static void travel( Node now){
		if(path.length() < 30000){			
			if(now.equals(start)/*&& path.length()> 101*/){//at the moment we save every cycle that starts at the node start. My guess is that the right length is "number of edges" + "length of the content of one node".
				candidates.add(path);
			}		
			for(Node n: now.getNeighbors()){
				String currentEdge = appendToPath(now.getContent(),n);
				if(countOccurrence(path,currentEdge) == edges.get(currentEdge)) continue;
				//System.out.println(path.length());
				currentEdge = null;
				//System.out.println(level);
				path = appendToPath(path,n);
				travel( n);
				path = popToPath (path,n);
			}			
		}
		else{
			System.out.println("Shit is over 9000");
		}
	}

	public static String appendToPath( String in_string, Node n){
		/*StringBuilder result = new StringBuilder(in_string.length()+1);
		String node = n.getContent().substring(n.getContent().length()-1);
		result.append(in_string);
		result.append(node);
		return result.toString();*/
		String node = n.getContent().substring(n.getContent().length()-1);
		return in_string+node;
	}
	
	public static String popToPath(String in_string, Node n){
		//StringBuilder result = new StringBuilder(in_string.length()-1);
		return path.substring(0, path.length()-1);	
	}
	
