	public static void generatePerfectReads(String source, int readLength){
		
		String ciclicData = source + source.substring(0, readLength-1);
		String str;
		
		for(int i = 0; i < source.length(); i++){
			str = ciclicData.substring(i,i+readLength);
			
			if(reads.containsKey(str)){
				reads.put(str,reads.get(str)+1);
			}
			else{
				reads.put(str,1);
			}
		}
	}
	
	public static void generateGraph(int readLength){
		
		//generatePerfectReads(source, readLength);
		
		edges = new HashMap<String,Integer>(reads);//as long as we do not simulate the experiment
		
		
		for(String str: edges.keySet()){
			String nodeLable = str.substring(0, readLength-1);
			nodes.put(nodeLable,new Node(nodeLable)); //is enough to get all nodes because every node is the starting point of an edge(read)			
		}
		//after all nodes are created, set the edges of the graph up
		for(String str: edges.keySet()){
			//for(int i= 0; i < edges.get(str); i++){
				String prefix = str.substring(0, readLength-1);
				String suffix = str.substring(1, readLength);
				Node from = nodes.get(prefix);
				Node to = nodes.get(suffix);
				from.addNeighbor(to);
			//}
		}
	}
	
