	public static void saveEdges(){
		try {
			File f = new File("edges.dat");
			if(!f.exists()){
				f.createNewFile();
			}
			
			BufferedWriter bw = new BufferedWriter(new FileWriter(f));
			String prefix;
			String suffix;
			int readLength;
			
			for(String str: edges.keySet()){
				readLength = str.length();
				prefix = str.substring(0, readLength-1);
				suffix = str.substring(1, readLength);
				for(int i=0; i<edges.get(str); i++){
					bw.write(prefix);
					bw.write(";");
					bw.write(suffix);
					bw.newLine();
				}
			}
			
			bw.close();
			
		} catch (IOException e) {
			e.printStackTrace();
		}
	}

